import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-container">
        <div className="logo-section">
          <div className="logo-icon">
            <svg viewBox="0 0 100 100" className="tree-logo">
              {/* Tree trunk */}
              <rect x="45" y="60" width="10" height="25" fill="#8B4513" />

              {/* Tree roots */}
              <path d="M35 85 Q45 90 55 85 Q50 95 45 90 Q40 95 35 85" fill="#8B4513" />
              <path d="M55 85 Q65 90 75 85 Q70 95 65 90 Q60 95 55 85" fill="#8B4513" />

              {/* Tree branches and leaves */}
              <circle cx="50" cy="50" r="25" fill="#228B22" />
              <circle cx="40" cy="45" r="15" fill="#228B22" />
              <circle cx="60" cy="45" r="15" fill="#228B22" />
              <circle cx="50" cy="35" r="18" fill="#228B22" />
              <circle cx="35" cy="55" r="12" fill="#228B22" />
              <circle cx="65" cy="55" r="12" fill="#228B22" />
            </svg>
          </div>

          <div className="logo-text">
            <h1 className="logo-acronym">TUNISIAGBC</h1>
            <div className="logo-arabic">مجلس تونس للأبنية الخضراء</div>
            <div className="logo-english">TUNISIA GREEN BUILDING COUNCIL</div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
